package week1.day1;

public class PrintOddNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		System.out.println("Print Odd Numbers: ");
		
		for (int i=0; i<=100; i++)
		{
			if(i%2==1)
			System.out.println(i);
		}
		
			
			
			
			
		
  
	}

}
